import React from 'react';
import { CountdownCircleTimer } from 'react-countdown-circle-timer';

const App = () => {
  const totalSeconds = 60; // Change this to your desired countdown duration

  return (
    <div className="countdown-container">
      <CountdownCircleTimer
        isPlaying // Start the countdown
        duration={totalSeconds}
        colors={['#004777', '#F7B801', '#A30000', '#A30000']}
        colorsTime={[7, 5, 2, 0]}
        onComplete={() => {
          // You can add a function to handle what to do when the countdown is completed.
          console.log('Countdown completed');
        }}
      >
        {({ remainingTime, animatedColor }) => (
          <div className="timer">
            <div className="text">{remainingTime}</div>
            <div className="text">seconds</div>
          </div>
        )}
      </CountdownCircleTimer>
    </div>
  );
};

export default App;
